import React, { Component } from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';

export default class Table extends Component {

  state = {
    data: []
  }

  constructor(props) {
    super(props)
  }

  componentDidMount() {


    this.setState({
      data: this.props.data
    })

    this.wrangleData(this.props.data)
  }

  wrangleData(data) {
    console.log(data)
  }

  renderCols() {
    return (
    this.props.data.columns.map(function (item, i) {
      return(
        <Col md={2} xs={3}>{item}</Col>
      )
    })
    )


  }

  render() {
    return(
        <Row>
          {this.renderCols()}
        </Row>
    )
  }

}
